Aby mohly jednotlivé metody Controlleru pracovat s Drive, musí mít Controller v sobě uložený odkaz na instanci objektu Drive. Nejspíše takto: #include "Drive.h" class Controller {
public: Drive *drv;
} Pokud však s třídou Drive pracuje pouze implementace Controlleru, kompilátor potřebuje pouze vědět, že Drive je třída (a nic víc!) a není tak potřeba vkládat celý soubor s definicí API třídy Drive. Lze toto zjednodušit na: class Drive; // pouze forward class Controller {
public: Drive *drv;
} a soubor s deklarací Drive vkládáme až do cpp souboru #include "Controller.h"
#include "Drive.h" Controller:: ...... Toto lze použít při splnění podmínek: Všechny přístupy ke třídě Drive jsou přes ukazatel, nikoliv přímo instance objektu potřebuje znát velikost tedy plnou deklaraci ! k obsahu drv se nepřistupuje v headeru ale v kódu cpp. Jakékoliv inline funkce používající obsah drv potřebují znát plnou deklaraci !

